import React, { Component, useState, useEffect } from 'react';

export default function ResourcesPage() {
    return () => {
        const [count, setCount] = useState(0);

        React.useEffect(() => {
          document.title = 'Count' + count;
          return () => {

          };
        }, [count]);

        return (
          <div>
            <h1>Resources</h1>
            <button onClick={() => setCount(count + 1)}>
              Click Me + {count}
            </button>
          </div>
        );
    }
}
